INSERT INTO `proc` VALUES ('dbdataprestamos','cont_actualizar_cta_detallesBceAnt','PROCEDURE','cont_actualizar_cta_detallesBceAnt','SQL','CONTAINS_SQL','NO','DEFINER','IN `fechaDesde` date,IN `fechaHasta` date','','BEGIN\r\nDECLARE done INT DEFAULT 0;\r\n	DECLARE VarCuenta CHAR(50);\r\n	DECLARE VarDebito DECIMAL(12,2);\r\n	DECLARE VarCredito  DECIMAL(12,2);\r\n	\r\n	DECLARE cur1 CURSOR FOR SELECT TransDCuentaNo AS Cuenta,  \r\n				SUM(TransDDebito) AS Debito, \r\n				SUM(TransDCredito) AS Credito \r\n				FROM tbl_interfascontabletransacciones AS t, \r\n				tbl_interfasecontabletransaccionesdetalles AS td \r\n				WHERE t.TransID=td.TransDIDTrans \r\n				AND t.TransFechaMovimiento BETWEEN fechaDesde AND fechaHasta\r\n				GROUP BY TransDCuentaNo;\r\n\r\n	DECLARE CONTINUE HANDLER FOR SQLSTATE \'02000\' SET done = 1;\r\n	OPEN cur1;\r\n	REPEAT\r\n	FETCH cur1 INTO VarCuenta, VarDebito, VarCredito;\r\n		IF NOT done THEN\r\n		\r\n			\r\n			UPDATE tbl_catalogo AS c, tbl_catalogo_grupo AS cg SET c.BalanceAnterior=(VarDebito-VarCredito) WHERE c.Grupo=cg.ID AND c.CuentaNo=VarCuenta AND cg.Origen=1;\r\n			UPDATE tbl_catalogo AS c, tbl_catalogo_grupo AS cg SET c.BalanceAnterior=(VarCredito-VarDebito) WHERE c.Grupo=cg.ID AND c.CuentaNo=VarCuenta AND cg.Origen=2;\r\n			\r\n			\r\n		END IF;\r\n	UNTIL done END REPEAT;\r\n	CLOSE cur1;\r\n\r\nEND','randy@localhost','2023-02-08 16:59:24','2023-02-08 16:59:24','STRICT_TRANS_TABLES,NO_AUTO_CREATE_USER',''),('dbdataprestamos','CargarDepositosLibreta','PROCEDURE','CargarDepositosLibreta','SQL','CONTAINS_SQL','NO','DEFINER','in _CodSocio INT, in _NroCuenta VARCHAR(15), in _fecha DATE','','BEGIN\r\nSELECT d.fecha,d.monto AS Deposito,a.saldointeres AS Intereses,a.saldocapital AS Balance,d.Usuario AS Cajero \r\nFROM tbl_ahorros_depositos AS d\r\nINNER JOIN tbl_ahorros_cuentas AS a\r\nON d.idcliente=a.idcliente\r\nWHERE d.idcliente=_CodSocio AND a.CuentaNo=_NroCuenta AND d.fecha=_Fecha;\r\n\r\nEND','root@localhost','2023-02-17 03:04:57','2023-02-17 03:04:57','STRICT_TRANS_TABLES,NO_AUTO_CREATE_USER',''),('dbdataprestamos','CargarRetirosLibreta','PROCEDURE','CargarRetirosLibreta','SQL','CONTAINS_SQL','NO','DEFINER',' in _CodSocio int, in _NroCuenta varchar(8), in _fecha date','','BeGIN\r\nSELECT d.fecha,monto AS Retiro,a.saldointeres AS Intereses,a.saldocapital AS Balance,d.Usuario AS Cajero \r\nFROM tbl_ahorros_retiros  AS d\r\nINNER JOIN tbl_ahorros_cuentas AS a\r\nON d.idcliente=a.idcliente\r\nWHERE d.idcliente=_CodSocio AND a.CuentaNo=_NroCuenta AND d.fecha=_Fecha;\r\n\r\nEND','root@localhost','2023-02-08 16:59:24','2023-02-08 16:59:24','STRICT_TRANS_TABLES,NO_AUTO_CREATE_USER',''),('dbdataprestamos','cont_actualizar_cta_controles','PROCEDURE','cont_actualizar_cta_controles','SQL','CONTAINS_SQL','NO','DEFINER','IN `fechaDesde` date,IN `fechaHasta` date','','BEGIN\r\nDECLARE done INT DEFAULT 0;\r\n	DECLARE VarCuenta CHAR(50);\r\n	DECLARE VarGrupo CHAR(50);\r\n	DECLARE VarSubGrupo CHAR(50);\r\n	DECLARE VarSubCuenta CHAR(50);\r\n	DECLARE VarDebito DECIMAL(12,2);\r\n	DECLARE VarCredito  DECIMAL(12,2);\r\n	\r\n	DECLARE cur1 CURSOR FOR SELECT LEFT(TransDCuentaNo,1) AS Cuenta, \r\n				LEFT(TransDCuentaNo,2) AS Grupo, \r\n				LEFT(TransDCuentaNo,3) AS SubGrupo, \r\n				LEFT(TransDCuentaNo,4) AS SubCuenta,  \r\n				SUM(TransDDebito) AS Debito, \r\n				SUM(TransDCredito) AS Credito\r\n				FROM tbl_interfascontabletransacciones AS t, \r\n				tbl_interfasecontabletransaccionesdetalles AS td\r\n				WHERE t.TransID=td.TransDIDTrans\r\n				AND DATE(t.TransFechaMovimiento) BETWEEN fechaDesde AND fechaHasta\r\n				GROUP BY TransDCuentaNo;\r\n\r\n	DECLARE CONTINUE HANDLER FOR SQLSTATE \'02000\' SET done = 1;\r\n	OPEN cur1;\r\n	REPEAT\r\n	FETCH cur1 INTO VarCuenta, VarGrupo, VarSubGrupo, VarSubCuenta, VarDebito, VarCredito;\r\n		IF NOT done THEN\r\n		\r\n			\r\n			UPDATE tbl_catalogo AS c, tbl_catalogo_grupo AS cg SET c.Balance=c.Balance+(VarCredito-VarDebito), c.Debito=c.Debito+VarDebito, c.Credito=c.Credito+VarCredito WHERE c.Grupo=cg.ID AND c.CuentaNo=VarCuenta AND cg.Origen=2;\r\n			UPDATE tbl_catalogo AS c, tbl_catalogo_grupo AS cg SET c.Balance=c.Balance+(VarDebito-VarCredito), c.Debito=c.Debito+VarDebito, c.Credito=c.Credito+VarCredito WHERE c.Grupo=cg.ID AND c.CuentaNo=VarCuenta AND cg.Origen=1;\r\n			\r\n			UPDATE tbl_catalogo AS c, tbl_catalogo_grupo AS cg SET c.Balance=c.Balance+(VarCredito-VarDebito), c.Debito=c.Debito+VarDebito, c.Credito=c.Credito+VarCredito WHERE c.Grupo=cg.ID AND c.CuentaNo=VarGrupo AND cg.Origen=2;\r\n			UPDATE tbl_catalogo AS c, tbl_catalogo_grupo AS cg SET c.Balance=c.Balance+(VarDebito-VarCredito), c.Debito=c.Debito+VarDebito, c.Credito=c.Credito+VarCredito WHERE c.Grupo=cg.ID AND c.CuentaNo=VarGrupo AND cg.Origen=1;\r\n			\r\n			UPDATE tbl_catalogo AS c, tbl_catalogo_grupo AS cg SET c.Balance=c.Balance+(VarCredito-VarDebito), c.Debito=c.Debito+VarDebito, c.Credito=c.Credito+VarCredito WHERE c.Grupo=cg.ID AND c.CuentaNo=VarSubGrupo AND cg.Origen=2;\r\n			UPDATE tbl_catalogo AS c, tbl_catalogo_grupo AS cg SET c.Balance=c.Balance+(VarDebito-VarCredito), c.Debito=c.Debito+VarDebito, c.Credito=c.Credito+VarCredito WHERE c.Grupo=cg.ID AND c.CuentaNo=VarSubGrupo AND cg.Origen=1;\r\n			\r\n			UPDATE tbl_catalogo AS c, tbl_catalogo_grupo AS cg SET c.Balance=c.Balance+(VarCredito-VarDebito), c.Debito=c.Debito+VarDebito, c.Credito=c.Credito+VarCredito WHERE c.Grupo=cg.ID AND c.CuentaNo=VarSubCuenta AND cg.Origen=2;\r\n			UPDATE tbl_catalogo AS c, tbl_catalogo_grupo AS cg SET c.Balance=c.Balance+(VarDebito-VarCredito), c.Debito=c.Debito+VarDebito, c.Credito=c.Credito+VarCredito WHERE c.Grupo=cg.ID AND c.CuentaNo=VarSubCuenta AND cg.Origen=1;\r\n		END IF;\r\n	UNTIL done END REPEAT;\r\n	CLOSE cur1;\r\n\r\nEND','root@localhost','2023-02-08 16:59:24','2023-02-08 16:59:24','STRICT_TRANS_TABLES,NO_AUTO_CREATE_USER',''),('dbdataprestamos','cont_actualizar_cta_detalles','PROCEDURE','cont_actualizar_cta_detalles','SQL','CONTAINS_SQL','NO','DEFINER','IN `fechaDesde` date,IN `fechaHasta` date','','BEGIN\r\n\r\nDECLARE done INT DEFAULT 0;\r\n	DECLARE VarCuenta CHAR(50);\r\n	DECLARE VarDebito DECIMAL(12,2);\r\n	DECLARE VarCredito DECIMAL(12,2);\r\n	\r\n	DECLARE cur1 CURSOR FOR SELECT TransDCuentaNo AS Cuenta,  \r\n				SUM(TransDDebito) AS Debito, \r\n				SUM(TransDCredito) AS Credito\r\n				FROM tbl_interfascontabletransacciones AS t, \r\n				tbl_interfasecontabletransaccionesdetalles AS td\r\n				WHERE t.TransID=td.TransDIDTrans\r\n				AND DATE(t.TransFechaMovimiento) BETWEEN fechaDesde AND fechaHasta\r\n				GROUP BY TransDCuentaNo;\r\n\r\n	DECLARE CONTINUE HANDLER FOR SQLSTATE \'02000\' SET done = 1;\r\n	OPEN cur1;\r\n	REPEAT\r\n	FETCH cur1 INTO VarCuenta, VarDebito, VarCredito;\r\n		IF NOT done THEN\r\n		\r\n			\r\n			UPDATE tbl_catalogo AS c, tbl_catalogo_grupo AS cg SET c.Balance=(VarDebito-VarCredito), c.Debito=VarDebito, c.Credito=VarCredito WHERE c.Grupo=cg.ID AND c.CuentaNo=VarCuenta AND cg.Origen=1;\r\n			UPDATE tbl_catalogo AS c, tbl_catalogo_grupo AS cg SET c.Balance=(VarCredito-VarDebito), c.Debito=VarDebito, c.Credito=VarCredito WHERE c.Grupo=cg.ID AND c.CuentaNo=VarCuenta AND cg.Origen=2;\r\n			\r\n			\r\n		END IF;\r\n	UNTIL done END REPEAT;\r\n	CLOSE cur1;\r\n\r\n\r\nEND','root@localhost','2023-02-08 16:59:24','2023-02-08 16:59:24','STRICT_TRANS_TABLES,NO_AUTO_CREATE_USER',''),('dbdataprestamos','cont_actualizar_cta_controlesBceAnt','PROCEDURE','cont_actualizar_cta_controlesBceAnt','SQL','CONTAINS_SQL','NO','DEFINER','IN `fechaDesde` date,IN `fechaHasta` date','','BEGIN\r\n	DECLARE done INT DEFAULT 0;\r\n	DECLARE VarCuenta CHAR(50);\r\n	DECLARE VarGrupo CHAR(50);\r\n	DECLARE VarSubGrupo CHAR(50);\r\n	DECLARE VarSubCuenta CHAR(50);\r\n	DECLARE VarDebito DECIMAL(12,2);\r\n	DECLARE VarCredito  DECIMAL(12,2);\r\n	\r\n	DECLARE cur1 CURSOR FOR SELECT LEFT(TransDCuentaNo,1) AS Cuenta, \r\n				LEFT(TransDCuentaNo,2) AS Grupo, \r\n				LEFT(TransDCuentaNo,3) AS SubGrupo, \r\n				LEFT(TransDCuentaNo,4) AS SubCuenta,  \r\n				SUM(TransDDebito) AS Debito, \r\n				SUM(TransDCredito) AS Credito\r\n				FROM tbl_interfascontabletransacciones AS t, \r\n				tbl_interfasecontabletransaccionesdetalles AS td\r\n				WHERE t.TransID=td.TransDIDTrans\r\n				AND t.TransFechaMovimiento BETWEEN fechaDesde AND fechaHasta\r\n				GROUP BY TransDCuentaNo;\r\n\r\n	DECLARE CONTINUE HANDLER FOR SQLSTATE \'02000\' SET done = 1;\r\n	OPEN cur1;\r\n	REPEAT\r\n	FETCH cur1 INTO VarCuenta, VarGrupo, VarSubGrupo, VarSubCuenta, VarDebito, VarCredito;\r\n		IF NOT done THEN\r\n		\r\n			\r\n			UPDATE tbl_catalogo AS c, tbl_catalogo_grupo AS cg SET c.BalanceAnterior=c.BalanceAnterior+(VarCredito-VarDebito) WHERE c.Grupo=cg.ID AND c.CuentaNo=VarCuenta AND cg.Origen=2;\r\n			UPDATE tbl_catalogo AS c, tbl_catalogo_grupo AS cg SET c.BalanceAnterior=c.BalanceAnterior+(VarDebito-VarCredito) WHERE c.Grupo=cg.ID AND c.CuentaNo=VarCuenta AND cg.Origen=1;\r\n			\r\n			UPDATE tbl_catalogo AS c, tbl_catalogo_grupo AS cg SET c.BalanceAnterior=c.BalanceAnterior+(VarCredito-VarDebito) WHERE c.Grupo=cg.ID AND c.CuentaNo=VarGrupo AND cg.Origen=2;\r\n			UPDATE tbl_catalogo AS c, tbl_catalogo_grupo AS cg SET c.BalanceAnterior=c.BalanceAnterior+(VarDebito-VarCredito) WHERE c.Grupo=cg.ID AND c.CuentaNo=VarGrupo AND cg.Origen=1;\r\n			\r\n			UPDATE tbl_catalogo AS c, tbl_catalogo_grupo AS cg SET c.BalanceAnterior=c.BalanceAnterior+(VarCredito-VarDebito) WHERE c.Grupo=cg.ID AND c.CuentaNo=VarSubGrupo AND cg.Origen=2;\r\n			UPDATE tbl_catalogo AS c, tbl_catalogo_grupo AS cg SET c.BalanceAnterior=c.BalanceAnterior+(VarDebito-VarCredito) WHERE c.Grupo=cg.ID AND c.CuentaNo=VarSubGrupo AND cg.Origen=1;\r\n			\r\n			UPDATE tbl_catalogo AS c, tbl_catalogo_grupo AS cg SET c.BalanceAnterior=c.BalanceAnterior+(VarCredito-VarDebito) WHERE c.Grupo=cg.ID AND c.CuentaNo=VarSubCuenta AND cg.Origen=2;\r\n			UPDATE tbl_catalogo AS c, tbl_catalogo_grupo AS cg SET c.BalanceAnterior=c.BalanceAnterior+(VarDebito-VarCredito) WHERE c.Grupo=cg.ID AND c.CuentaNo=VarSubCuenta AND cg.Origen=1;\r\n		END IF;\r\n	UNTIL done END REPEAT;\r\n	CLOSE cur1;\r\n\r\n\r\nEND','root@localhost','2023-02-08 16:59:24','2023-02-08 16:59:24','STRICT_TRANS_TABLES,NO_AUTO_CREATE_USER',''),('dbdataprestamos','bce_banco','PROCEDURE','bce_banco','SQL','CONTAINS_SQL','NO','DEFINER','','','BEGIN\r\n    DECLARE done INT DEFAULT 0;\r\n    DECLARE a CHAR(50);\r\n    DECLARE cur1 CURSOR FOR SELECT fld_codigo FROM tbl_bancos;\r\n    DECLARE CONTINUE HANDLER FOR SQLSTATE \'02000\' SET done = 1;\r\n    OPEN cur1;\r\n  \r\n    REPEAT\r\n     FETCH cur1 INTO a;\r\n     IF NOT done THEN\r\n      CALL set_bce_banco(a);     \r\n    END IF;\r\n    UNTIL done END REPEAT;\r\n    CLOSE cur1; \r\nEND','root@localhost','2023-02-08 16:59:24','2023-02-08 16:59:24','STRICT_TRANS_TABLES,NO_AUTO_CREATE_USER',''),('dbdataprestamos','bce_clientes','PROCEDURE','bce_clientes','SQL','CONTAINS_SQL','NO','DEFINER','','','BEGIN\r\n    DECLARE done INT DEFAULT 0;\r\n    DECLARE a CHAR(50);\r\n    DECLARE cur1 CURSOR FOR SELECT fld_id FROM tbl_clientes;\r\n    DECLARE CONTINUE HANDLER FOR SQLSTATE \'02000\' SET done = 1;\r\n    OPEN cur1;\r\n  \r\n    REPEAT\r\n     FETCH cur1 INTO a;\r\n     IF NOT done THEN\r\n      CALL set_bce_cliente(a);     \r\n    END IF;\r\n    UNTIL done END REPEAT;\r\n    CLOSE cur1; \r\nEND','root@localhost','2023-02-08 16:59:24','2023-02-08 16:59:24','STRICT_TRANS_TABLES,NO_AUTO_CREATE_USER',''),('dbdataprestamos','cont_actualizar_cta_controles_a_cero','PROCEDURE','cont_actualizar_cta_controles_a_cero','SQL','CONTAINS_SQL','NO','DEFINER','','','BEGIN\r\n	update tbl_catalogo set Balance=0, Debito=0, Credito=0 where Tipo <>\'Auxiliar\';\r\n    END','root@localhost','2023-02-08 16:59:24','2023-02-08 16:59:24','STRICT_TRANS_TABLES,NO_AUTO_CREATE_USER',''),('dbdataprestamos','cont_actualizar_cta_detalles_a_cero','PROCEDURE','cont_actualizar_cta_detalles_a_cero','SQL','CONTAINS_SQL','NO','DEFINER','','','BEGIN\r\n	 UPDATE tbl_catalogo SET BalanceAnterior=0, Balance=0, Debito=0, Credito=0 WHERE Tipo =\'Auxiliar\';\r\n    END','root@localhost','2023-02-08 16:59:24','2023-02-08 16:59:24','STRICT_TRANS_TABLES,NO_AUTO_CREATE_USER',''),('dbdataprestamos','cont_delete_trans','PROCEDURE','cont_delete_trans','SQL','CONTAINS_SQL','NO','DEFINER','IN IdTrans INT(11)','','BEGIN\r\nDELETE from tbl_interfascontabletransacciones where TransID=IdTrans;\r\ndelete from tbl_interfasecontabletransaccionesdetalles where TransDIDTrans=IdTrans;\r\nEND','root@localhost','2023-02-08 16:59:24','2023-02-08 16:59:24','STRICT_TRANS_TABLES,NO_AUTO_CREATE_USER',''),('dbdataprestamos','cont_insert_trans','PROCEDURE','cont_insert_trans','SQL','CONTAINS_SQL','NO','DEFINER','in TransFechaMovimiento date , in TransDescripcion varchar(250), in TransIDTipo int(11), in TransUsuario varchar(25), in TransIDDoc int(11), in TransDoc varchar(50), in TransDocDetalle varchar(255)','','BEGIN\r\nINSERT INTO tbl_interfascontabletransacciones \r\n(TransFecha, TransFechaMovimiento, TransDescripcion, TransIDTipo, TransUsuario, TransIDDoc, TransDoc, TransDocDetalle)\r\nVALUES(Now(), TransFechaMovimiento, TransDescripcion, TransIDTipo, TransUsuario, TransIDDoc, TransDoc, TransDocDetalle);\r\nEND','root@localhost','2023-02-08 16:59:24','2023-02-08 16:59:24','STRICT_TRANS_TABLES,NO_AUTO_CREATE_USER',''),('dbdataprestamos','cont_insert_trans_detalle','PROCEDURE','cont_insert_trans_detalle','SQL','CONTAINS_SQL','NO','DEFINER','in TransDIDTrans Int(11), in TransDCuentaNo Varchar(15), in TransDDescripcionCuenta Varchar(80), in TransDDebito Decimal(12,2), in TransDCredito Decimal(12,2) ','','BEGIN\r\nINSERT INTO tbl_interfasecontabletransaccionesdetalles \r\n(TransDIDTrans, TransDCuentaNo, TransDDescripcionCuenta, TransDDebito, TransDCredito, TransDBalance)\r\nVALUES(TransDIDTrans, TransDCuentaNo, TransDDescripcionCuenta, TransDDebito, TransDCredito, 0);\r\nEND','root@localhost','2023-02-08 16:59:24','2023-02-08 16:59:24','STRICT_TRANS_TABLES,NO_AUTO_CREATE_USER',''),('dbdataprestamos','Imprimir_Libretas','PROCEDURE','Imprimir_Libretas','SQL','CONTAINS_SQL','NO','DEFINER','in _FechaImpresion date, in _HoraImpresion time, in _IdSocio int,\r\nin _NroLibreta int, in _NroCuenta varchar(7), in _Retiro double(14,4), in _Deposito double(14,4),\r\nin _Balance double(14,4), in _InteresesAcomulados double(14,4),in _IdCaja int, in _IdCajero int','','Begin \r\ninsert into Impresion_Libreta (FechaImpresion,HoraImpresion,IdSocio,NroLibreta,NroCuenta,Retiro,Deposito,\r\nBalance,InteresesAcomulados,IdCaja,IdCajero) values(\r\n_FechaImpresion,\r\n_HoraImpresion,\r\n_IdSocio,\r\n_NroLibreta,\r\n_NroCuenta,\r\n_Retiro,\r\n_Deposito,\r\n_Balance,\r\n_InteresesAcomulados,\r\n_IdCaja,\r\n_IdCajero\r\n);\r\nend','root@localhost','2023-02-08 16:59:24','2023-02-08 16:59:24','STRICT_TRANS_TABLES,NO_AUTO_CREATE_USER',''),('dbdataprestamos','set_bce_banco','PROCEDURE','set_bce_banco','SQL','CONTAINS_SQL','NO','DEFINER','idBanco Varchar(10)','','BEGIN\r\n    DECLARE dr DOUBLE(12,2);\r\n    DECLARE cr DOUBLE(12,2);\r\n    SELECT IFNULL(SUM(fld_dr),0) INTO dr FROM tbl_estado_banco WHERE fld_banco_id=idBanco;\r\n    SELECT IFNULL(SUM(fld_cr),0) INTO cr FROM tbl_estado_banco WHERE fld_banco_id=idBanco;\r\n    UPDATE tbl_bancos SET fld_balance=(dr-cr) WHERE fld_codigo=idBanco;\r\nEND','root@localhost','2023-02-08 16:59:24','2023-02-08 16:59:24','STRICT_TRANS_TABLES,NO_AUTO_CREATE_USER',''),('dbdataprestamos','set_bce_cliente','PROCEDURE','set_bce_cliente','SQL','CONTAINS_SQL','NO','DEFINER','id_cliente INT(10)','','BEGIN\r\n    DECLARE dr DOUBLE(12,2);\r\n    DECLARE cr DOUBLE(12,2);\r\n    SELECT IFNULL(SUM(Debito),0) INTO dr FROM clienteestadocuenta WHERE IDCliente=id_cliente;\r\n    SELECT IFNULL(SUM(Credito),0) INTO cr FROM clienteestadocuenta WHERE IDCliente=id_cliente;\r\n    UPDATE tbl_clientes SET fld_bce=(dr-cr) WHERE fld_id=id_cliente;\r\nEND','root@localhost','2023-02-08 16:59:24','2023-02-08 16:59:24','STRICT_TRANS_TABLES,NO_AUTO_CREATE_USER',''),('dbdataprestamos','set_bce_prestamos','PROCEDURE','set_bce_prestamos','SQL','CONTAINS_SQL','NO','DEFINER','id_prestamo INT(10)','','BEGIN\r\n    DECLARE dr DOUBLE(12,2);\r\n    DECLARE cr DOUBLE(12,2);\r\n    SELECT IFNULL(SUM(fld_capital_cuota_balance),0) INTO dr FROM tbl_cuotas WHERE fld_id_del_prestamo=id_prestamo;\r\n    SELECT IFNULL(SUM(fld_interes_cuota_balance),0) INTO cr FROM tbl_cuotas WHERE fld_id_del_prestamo=id_prestamo;\r\n    UPDATE tbl_prestamos SET fld_balance=(dr+cr) WHERE fld_id_prestamos=id_prestamo;\r\nEND','root@localhost','2023-02-08 16:59:24','2023-02-08 16:59:24','STRICT_TRANS_TABLES,NO_AUTO_CREATE_USER',''),('dbdataprestamos','set_bce_proveedor','PROCEDURE','set_bce_proveedor','SQL','CONTAINS_SQL','NO','DEFINER','id_prove INT(10)','','BEGIN\r\n    DECLARE dr DOUBLE(12,2);\r\n    DECLARE cr DOUBLE(12,2);\r\n    SELECT IFNULL(SUM(fld_dr),0) INTO dr FROM tbl_estado_proveedor WHERE fld_proveedor_id=id_prove;\r\n    SELECT IFNULL(SUM(fld_cr),0) INTO cr FROM tbl_estado_proveedor WHERE fld_proveedor_id=id_prove;\r\n    UPDATE tbl_supplier SET fldBalance=(cr-dr) WHERE fldSupplierID =id_prove;\r\nEND','root@localhost','2023-02-08 16:59:24','2023-02-08 16:59:24','STRICT_TRANS_TABLES,NO_AUTO_CREATE_USER',''),('dbdataprestamos','set_estado_cta_cliente','PROCEDURE','set_estado_cta_cliente','SQL','CONTAINS_SQL','NO','DEFINER','id_cliente INT(10)','','BEGIN\r\n    TRUNCATE tbl_estado_clientes;\r\n    \r\n    INSERT INTO tbl_estado_clientes (fld_date,fld_description,fld_dr,fld_cr,fld_cliente_id,fld_tipo_doc,fld_tipo_doc_id) \r\n    (SELECT fld_fecha_entrega, \'FINANCIAMIENTO\',fld_monto,0,id_cliente,\'PRESTAMOS\',fld_id_prestamos FROM tbl_prestamos WHERE fld_id_del_cliente=id_cliente AND fld_status_prestamos=\'Nuevo\' );\r\n    \r\n    INSERT INTO tbl_estado_clientes (fld_date,fld_description,fld_dr,fld_cr,fld_cliente_id,fld_tipo_doc,fld_tipo_doc_id) \r\n    (SELECT fld_date,fld_Description,0,fld_monto,fld_id_cliente_ri,\'RECIBOCOBROCXC\',fld_Id_RI  FROM tbl_recibo_ingresos_cxc WHERE fld_id_cliente_ri=id_cliente AND fld_Estado=\'NEW\' );\r\n     \r\n      INSERT INTO tbl_estado_clientes (fld_date,fld_description,fld_dr,fld_cr,fld_cliente_id,fld_tipo_doc,fld_tipo_doc_id) \r\n    (SELECT fld_fecha,fld_concepto,fld_monto,0,fld_cliente_id_nd,\'NDCXC\',fld_id_nd_cxc  FROM tbl_nd_cxc WHERE fld_cliente_id_nd=id_cliente AND fld_status_nd=\'N\' );\r\n     \r\n      INSERT INTO tbl_estado_clientes (fld_date,fld_description,fld_dr,fld_cr,fld_cliente_id,fld_tipo_doc,fld_tipo_doc_id) \r\n    (SELECT fld_fecha,fld_concepto,0,fld_monto,fld_cliente_id_nc,\'NCCXC\',fld_id_nc_cxc  FROM tbl_nc_cxc WHERE fld_cliente_id_nc=id_cliente AND fld_status_nc=\'N\' );\r\n     \r\nEND','root@localhost','2023-02-15 23:13:20','2023-02-15 23:13:20','STRICT_TRANS_TABLES,NO_AUTO_CREATE_USER',''),('dbdataprestamos','solicitudcreditogastos_flia','PROCEDURE','solicitudcreditogastos_flia','SQL','CONTAINS_SQL','NO','DEFINER','in _fld_id_sol int, in _fld_vivienda double(10,2),\r\nin _fld_alimentacion double(10,2),in _fld_transporte double(10,2),in _fld_educacion double(10,2),\r\nin _fld_otros double(10,2),_fld_total_gastos double(10,2)','','begin\r\ninsert into tbl_solicitudcreditogastos_flia(fldid,fld_id_sol,fld_vivienda,fld_alimentacion,\r\nfld_transporte,fld_educacion,fld_otros,fld_total_gastos)\r\nvalues(null,\r\n_fld_id_sol,\r\n_fld_vivienda,\r\n_fld_alimentacion,\r\n_fld_transporte,\r\n_fld_educacion,\r\n_fld_otros,\r\n_fld_total_gastos\r\n);\r\nend','root@localhost','2023-02-08 16:59:24','2023-02-08 16:59:24','STRICT_TRANS_TABLES,NO_AUTO_CREATE_USER',''),('dbdataprestamos','spActualizarBeneficiarios','PROCEDURE','spActualizarBeneficiarios','SQL','CONTAINS_SQL','NO','DEFINER',' IN _CodCliente INT,  IN _NombreBeneficiario VARCHAR(100), IN _ParentescoBeneficiario VARCHAR(50),\r\n				   IN _CedulaBeneficiario VARCHAR(16), IN _TelBeneficiario VARCHAR(13), IN _CelularBeneficiario VARCHAR(13),\r\n				   IN _WhatsappBeneficiario VARCHAR(13),IN _NombreBeneficiario2 VARCHAR(100), IN 