, IN fechaHasta date\r\n','','BEGIN DECLARE done INT DEFAULT 0;\r\nDECLARE VarCuenta CHAR(50);\r\nDECLARE VarDebito DECIMAL(12, 2);\r\nDECLARE VarCredito DECIMAL(12, 2);\r\nDECLARE cur1 CURSOR FOR \r\nSELECT \r\n  TransDCuentaNo AS Cuenta, \r\n  SUM(TransDDebito) AS Debito, \r\n  SUM(TransDCredito) AS Credito \r\nFROM \r\n  tbl_interfascontabletransacciones AS t, \r\n  tbl_interfasecontabletransaccionesdetalles AS td \r\nWHERE \r\n  t.TransID = td.TransDIDTrans \r\n  AND t.TransFechaMovimiento BETWEEN fechaDesde \r\n  AND fechaHasta \r\nGROUP BY \r\n  TransDCuentaNo;\r\nDECLARE CONTINUE HANDLER FOR SQLSTATE \'02000\' \r\nSET \r\n  done = 1;\r\nOPEN cur1;\r\nREPEAT FETCH cur1 INTO VarCuenta, \r\nVarDebito, \r\nVarCredito;\r\nIF NOT done THEN \r\nUPDATE \r\n  tbl_catalogo AS c, \r\n  tbl_catalogo_grupo AS cg \r\nSET \r\n  c.BalanceAnterior =(VarDebito - VarCredito) \r\nWHERE \r\n  c.Grupo = cg.ID \r\n  AND c.CuentaNo = VarCuenta \r\n  AND cg.Origen = 1;\r\nUPDATE \r\n  tbl_catalogo AS c, \r\n  tbl_catalogo_grupo AS cg \r\nSET \r\n  c.BalanceAnterior =(VarCredito - VarDebito) \r\nWHERE \r\n  c.Grupo = cg.ID \r\n  AND c.CuentaNo = VarCuenta \r\n  AND cg.Origen = 2;\r\nEND IF;\r\nUNTIL done END REPEAT;\r\nCLOSE cur1;\r\nEND','randy@localhost','2023-02-27 21:12:15','2023-02-27 21:12:15','STRICT_TRANS_TABLES,NO_AUTO_CREATE_USER',''),('dbdataprestamoscoopsme','fn_ultimo_id','FUNCTION','fn_ultimo_id','SQL','CONTAINS_SQL','NO','DEFINER','\r\n  campo varchar(15)\r\n','int(11)','BEGIN \r\nSET \r\n  @idPrimary = 1;\r\nSELECT \r\n  MAX(campo) INTO @idPrimary \r\nFROM \r\n  tbl_clientes;\r\nRETURN @idPrimary;\r\nEND','randy@localhost','2023-02-27 21:12:16','2023-02-27 21:12:16','STRICT_TRANS_TABLES,NO_AUTO_CREATE_USER',''),('dbdataprestamoscoopsme','sp_solicitudcreditonota','PROCEDURE','sp_solicitudcreditonota','SQL','CONTAINS_SQL','NO','DEFINER','in _Fecha datetime, in _IdSolicitud int, in _IdUser int,\r\nin _Nota varchar(255), in _comentario_Officer_negocio varchar(255), in _com