'BEGIN\r\nSET @idPrimary=1;\r\nSELECT MAX(campo) INTO @idPrimary FROM tbl_clientes;\r\nRETURN @idPrimary;\r\nEND','root@localhost','2023-02-08 16:59:24','2023-02-08 16:59:24','STRICT_TRANS_TABLES,NO_AUTO_CREATE_USER',''),('dbdataprestamos','sp_insertar_roles','PROCEDURE','sp_insertar_roles','SQL','CONTAINS_SQL','NO','DEFINER','in _roles VARCHAR(50)','','Begin\r\ninsert into tbl_user_rol (rol) values(_roles);\r\n\r\nEnd','root@localhost','2023-02-15 23:47:00','2023-02-15 23:47:00','STRICT_TRANS_TABLES,NO_AUTO_CREATE_USER',''),('dbdataprestamoscoopsme','cont_actualizar_cta_controlesBceAnt','PROCEDURE','cont_actualizar_cta_controlesBceAnt','SQL','CONTAINS_SQL','NO','DEFINER','IN fechaDesde DATE, IN fechaHasta DATE','','BEGIN\r\n	DECLARE done INT DEFAULT 0;\r\n	DECLARE VarCuenta CHAR(50);\r\n	DECLARE VarGrupo CHAR(50);\r\n	DECLARE VarSubGrupo CHAR(50);\r\n	DECLARE VarSubCuenta CHAR(50);\r\n	DECLARE VarDebito DECIMAL(12,2);\r\n	DECLARE VarCredito  DECIMAL(12,2);\r\n	\r\n	DECLARE cur1 CURSOR FOR SELECT LEFT(TransDCuentaNo,1) AS Cuenta, \r\n				LEFT(TransDCuentaNo,2) AS Grupo, \r\n				LEFT(TransDCuentaNo,3) AS SubGrupo, \r\n				LEFT(TransDCuentaNo,4) AS SubCuenta,  \r\n				SUM(TransDDebito) AS Debito, \r\n				SUM(TransDCredito) AS Credito \r\n				FROM tbl_interfascontabletransacciones AS t, \r\n				tbl_interfasecontabletransaccionesdetalles AS td \r\n				WHERE t.TransID=td.TransDIDTrans \r\n				AND t.TransFechaMovimiento BETWEEN fechaDesde AND fechaHasta\r\n				GROUP BY TransDCuentaNo;\r\n       \r\n	DECLARE CONTINUE HANDLER FOR SQLSTATE \'02000\' SET done = 1;\r\n	OPEN cur1;\r\n	REPEAT\r\n	FETCH cur1 INTO VarCuenta, VarGrupo, VarSubGrupo, VarSubCuenta, VarDebito, VarCredito;\r\n		IF NOT done THEN\r\n		\r\n			\r\n			UPDATE tbl_catalogo AS c, tbl_catalogo_grupo AS cg SET c.BalanceAnterior=c.BalanceAnterior+(VarCredito-VarDebito) WHERE c.Grupo=cg.ID AND c.CuentaNo=VarCuenta AND cg.Origen=2;\r\n			UPDATE tbl_catalogo AS c, tbl_catalogo_grupo AS cg SET c.BalanceAnterior=c.BalanceAnterior+(VarDebito-VarCredito) WHERE c.Grupo=cg.ID AND c.CuentaNo=VarCuenta AND cg.Origen=1;\r\n			\r\n			UPDATE tbl_catalogo AS c, tbl_catalogo_grupo AS cg SET c.BalanceAnterior=c.BalanceAnterior+(VarCredito-VarDebito) WHERE c.Grupo=cg.ID AND c.CuentaNo=VarGrupo AND cg.Origen=2;\r\n			UPDATE tbl_catalogo AS c, tbl_catalogo_grupo AS cg SET c.BalanceAnterior=c.BalanceAnterior+(VarDebito-VarCredito) WHERE c.Grupo=cg.ID AND c.CuentaNo=VarGrupo AND cg.Origen=1;\r\n			\r\n			UPDATE tbl_catalogo AS c, tbl_catalogo_grupo AS cg SET c.BalanceAnterior=c.BalanceAnterior+(VarCredito-VarDebito) WHERE c.Grupo=cg.ID AND c.CuentaNo=VarSubGrupo AND cg.Origen=2;\r\n			UPDATE tbl_catalogo AS c, tbl_catalogo_grupo AS cg SET c.BalanceAnterior=c.BalanceAnterior+(VarDebito-VarCredito) WHERE c.Grupo=cg.ID AND c.CuentaNo=VarSubGrupo AND cg.Origen=1;\r\n			\r\n			UPDATE tbl_catalogo AS c, tbl_catalogo_grupo AS cg SET c.BalanceAnterior=c.BalanceAnterior+(VarCredito-VarDebito) WHERE c.Grupo=cg.ID AND c.CuentaNo=VarSubCuenta AND cg.Origen=2;\r\n			UPDATE tbl_catalogo AS c, tbl_catalogo_grupo AS cg SET c.BalanceAnterior=c.BalanceAnterior+(VarDebito-VarCredito) WHERE c.Grupo=cg.ID AND c.CuentaNo=VarSubCuenta AND cg.Origen=1;\r\n		END IF;\r\n	UNTIL done END REPEAT;\r\n	CLOSE cur1; \r\n    END','root@localhost','2023-02-27 15:30:23','2023-02-27 15:30:23','STRICT_TRANS_TABLES,NO_AUTO_CREATE_USER',''),('dbdataprestamoscoopsme','cont_actualizar_cta_controles_a_cero','PROCEDURE','cont_actualizar_cta_controles_a_cero','SQL','CONTAINS_SQL','NO','DEFINER','','','BEGIN\r\n	update tbl_catalogo set Balance=0, Debito=0, Credito=0 where Tipo <>\'Auxiliar\';\r\n    END','root@localhost','2023-02-27 15:30:23','2023-02-27 15:30:23','STRICT_TRANS_TABLES,NO_AUTO_CREATE_USER',''),('dbdataprestamoscoopsme','cont_actualizar_cta_detalles','PROCEDURE','cont_actualizar_cta_detalles','SQL','CONTAINS_SQL','NO','DEFINER','IN fechaDesde DATE, IN fechaHasta DATE','','BEGIN\r\nDECLARE done INT DEFAULT 0;\r\n	DECLARE VarCuenta CHAR(50);\r\n	DECLARE VarDebito DECIMAL(12,2);\r\n	DECLARE VarCredito  DECIMAL(12,2);\r\n	\r\n	DECLARE cur1 CURSOR FOR SELECT TransDCuentaNo AS Cuenta,  \r\n				SUM(TransDDebito) AS Debito, \r\n				SUM(TransDCredito) AS Credito \r\n				FROM tbl_interfascontabletransacciones AS t, \r\n				tbl_interfasecontabletransaccionesdetalles AS td \r\n				WHERE t.TransID=td.TransDIDTrans \r\n				AND DATE(t.TransFechaMovimiento) BETWEEN fechaDesde AND fechaHasta\r\n				GROUP BY TransDCuentaNo;\r\n       \r\n	DECLARE CONTINUE HANDLER FOR SQLSTATE \'02000\' SET done = 1;\r\n	OPEN cur1;\r\n	REPEAT\r\n	FETCH cur1 INTO VarCuenta, VarDebito, VarCredito;\r\n		IF NOT done THEN\r\n		\r\n			\r\n			UPDATE tbl_catalogo AS c, tbl_catalogo_grupo AS cg SET c.Balance=(VarDebito-VarCredito), c.Debito=VarDebito, c.Credito=VarCredito WHERE c.Grupo=cg.ID AND c.CuentaNo=VarCuenta AND cg.Origen=1;\r\n			UPDATE tbl_catalogo AS c, tbl_catalogo_grupo AS cg SET c.Balance=(VarCredito-VarDebito), c.Debito=VarDebito, c.Credito=VarCredito WHERE c.Grupo=cg.ID AND c.CuentaNo=VarCuenta AND cg.Origen=2;\r\n			\r\n			\r\n		END IF;\r\n	UNTIL done END REPEAT;\r\n	CLOSE cur1; \r\n    END','root@localhost','2023-02-27 15:30:23','2023-02-27 15:30:23','STRICT_TRANS_TABLES,NO_AUTO_CREATE_USER',''),('dbdataprestamoscoopsme','cont_actualizar_cta_detalles_a_cero','PROCEDURE','cont_actualizar_cta_detalles_a_cero','SQL','CONTAINS_SQL','NO','DEFINER','','','BEGIN\r\n	 UPDATE tbl_catalogo SET BalanceAnterior=0, Balance=0, Debito=0, Credito=0 WHERE Tipo =\'Auxiliar\';\r\n    END','root@localhost','2023-02-27 15:30:23','2023-02-27 15:30:23','STRICT_TRANS_TABLES,NO_AUTO_CREATE_USER',''),('dbdataprestamoscoopsme','cont_delete_trans','PROCEDURE','cont_delete_trans','SQL','CONTAINS_SQL','NO','DEFINER','IN IdTrans INT(11)','','BEGIN\r\nDELETE from tbl_interfascontabletransacciones where TransID=IdTrans;\r\ndelete from tbl_interfasecontabletransaccionesdetalles where TransDIDTrans=IdTrans;\r\nEND','root@localhost','2023-02-27 15:3