,InteresesAcomulados,IdCaja,IdCajero) values(\r\n_FechaImpresion,\r\n_HoraImpresion,\r\n_IdSocio,\r\n_NroLibreta,\r\n_NroCuenta,\r\n_Retiro,\r\n_Deposito,\r\n_Balance,\r\n_InteresesAcomulados,\r\n_IdCaja,\r\n_IdCajero\r\n);\r\nend','root@localhost','2023-02-27 15:30:23','2023-02-27 15:30:23','STRICT_TRANS_TABLES,NO_AUTO_CREATE_USER',''),('dbdataprestamoscoopsme','set_bce_banco','PROCEDURE','set_bce_banco','SQL','CONTAINS_SQL','NO','DEFINER','idBanco Varchar(10)','','BEGIN\r\n    DECLARE dr DOUBLE(12,2);\r\n    DECLARE cr DOUBLE(12,2);\r\n    SELECT IFNULL(SUM(fld_dr),0) INTO dr FROM tbl_estado_banco WHERE fld_banco_id=idBanco;\r\n    SELECT IFNULL(SUM(fld_cr),0) INTO cr FROM tbl_estado_banco WHERE fld_banco_id=idBanco;\r\n    UPDATE tbl_bancos SET fld_balance=(dr-cr) WHERE fld_codigo=idBanco;\r\nEND','root@localhost','2023-02-27 15:30:23','2023-02-27 15:30:23','STRICT_TRANS_TABLES,NO_AUTO_CREATE_USER',''),('dbdataprestamoscoopsme','set_bce_cliente','PROCEDURE','set_bce_cliente','SQL','CONTAINS_SQL','NO','DEFINER','id_cliente INT(10)','','BEGIN\r\n    DECLARE dr DOUBLE(12,2);\r\n    DECLARE cr DOUBLE(12,2);\r\n    SELECT IFNULL(SUM(Debito),0) INTO dr FROM clienteestadocuenta WHERE IDCliente=id_cliente;\r\n    SELECT IFNULL(SUM(Credito),0) INTO cr FROM clienteestadocuenta WHERE IDCliente=id_cliente;\r\n    UPDATE tbl_clientes SET fld_bce=(dr-cr) WHERE fld_id=id_cliente;\r\nEND','root@localhost','2023-02-27 15:30:23','2023-02-27 15:30:23','STRICT_TRANS_TABLES,NO_AUTO_CREATE_USER',''),('dbdataprestamoscoopsme','set_bce_prestamos','PROCEDURE','set_bce_prestamos','SQL','CONTAINS_SQL','NO','DEFINER','id_prestamo INT(10)','','BEGIN\r\n    DECLARE dr DOUBLE(12,2);\r\n    DECLARE cr DOUBLE(12,2);\r\n    SELECT IFNULL(SUM(fld_capital_cuota_balance),0) INTO dr FROM tbl_cuotas WHERE fld_id_del_prestamo=id_prestamo;\r\n    SELECT IFNULL(SUM(fld_interes_cuota_balance),0) INTO cr FROM tbl_cuotas WHERE fld_id_del_prestamo=id_prestamo;\r\n    UPDATE tbl_prestamos SET fld_balance=(dr+